import { Route, Switch } from 'react-router-dom';
import { useCategories } from '../../hooks/categories';
// import { withAuthService, WithStoreService } from '../hoc';
import { HomePage, CartPage, Orders, Login, RegistrationForm, Product } from '../pages';
import Category from '../pages/category/category';

const Routes = () => {
  const { data: categories } = useCategories()
  return (
    <Switch>
      <Route path="/login" component={Login} />
      <Route path="/" component={HomePage} exact />
      <Route path="/cart" component={CartPage} />
      <Route path="/orders" component={Orders} />
      <Route path="/register" component={RegistrationForm} />
      <Route exact path="/product/:id" component={Product} />
      {
        categories && categories.map((category: String) => {<Route exact path={`/product/${category}`}>
          <Category categoryType={category}/>
        </Route>})
      }
    </Switch>
  )

}

// const Routes = WithStoreService(RoutesWrapper);


export default Routes
